import React from 'react';
import styled from 'styled-components';
import heroPic from '../pexels-garrett-morrow-682933.jpg';

const Hero = () => {
	return (
		<HeroWrapper>
			<img src={heroPic} alt='' />
		</HeroWrapper>
	);
};

export default Hero;

const HeroWrapper = styled.section`
	min-height: 60vh;
	max-height: 80vh;
	width: 100%;

	img {
		height: 100%;
	}
`;
